(window.webpackJsonp=window.webpackJsonp||[]).push([[354],{982:function(n,t){n.exports='\x3c!--\ntitle: Typora\nsort:\n--\x3e\n\n# Typora 笔记\n\n官方网站：[typora](https://www.typora.io/)\n\n### 自动上传图片\n\n> picgo 与 gitee\n\n## 基本使用\n\n> 链接： [test](www.baidu.com)\n>\n> 删除线：~~test~~\n>\n> 上标： x^4^\n>\n> 下标： H~2~\n>\n> 数学： $e^2$\n>\n> - [x] asdf\n>\n> test[^1]\n>\n> [^1]: it\'s a infomation\n>\n> :happy:\n>\n> [锚链接](#test)\n>\n> <https://www.baidu.com>\n\n### 源代码\n\n```markdown\n链接: [test](www.baidu.com)\n删除线: ~~test~~\n上标: X^4^\n下标: H~2~\n数学 $e^2$\n方框: - [ ] asdf - [x] asdf\n说明: test[^1]\n[^1]:it\'s a infomation\nEmoji: :happy:\n锚链接: [锚链接](#test) ## 流程图 {#test}\n快速链接： <https://www.baidu.com>\n```\n\n## 插入图片\n\n- 插入本地图片：(不灵活，不便于分享)\n\n  ```markdown\n  ![avatar](./picture/1.png) # Linux\n  ![avatar](.\\photo\\1.png) # windows\n  ```\n\n- 插入网络图片：\n\n  ```markdown\n  ![avatar](https://www.baidu.com/img/bd_logo1.png?where=super)\n  ```\n\n- 把图片插入 markdown 文件：\n\n  ```markdown\n  ![avatar](data:image/png;base64,)\n  ```\n\n  > 但是会影响写文章的体验。\n  >\n  > 可以把大段的 base64 字符串放在文章末尾，然后在文章中通过一个 id 来调用。\n\n  ```markdown\n  ![avatar][test]\n  [test](data:image/png;base64,iVBORw0KGgoAAAANSUh...)\n  ```\n\n## 绘图\n\n### 流程图\n\n```\n# mermaid\ngraph TD;\n    A--\x3eB;\n    A--\x3eC;\n    B--\x3eD;\n```\n\n> TD 代表方向：Top-Down\n\n```mermaid\ngraph TD;\n    A--\x3eB;\n    A--\x3eC;\n    B--\x3eD;\n```\n\n### 时序图\n\n```\nsequenceDiagram\n    Alice->>John: Hello John, how are you?\n    John--\x3e>Alice: Great!\n```\n\n> `->>` 代表实线箭头，`--\x3e>` 则代表虚线。\n\n```mermaid\nsequenceDiagram\n    Alice->>John: Hello John, how are you?\n    John--\x3e>Alice: Great!\n```\n\n### 状态图\n\n```\nstateDiagram\n    [*] --\x3e s1\n    s1 --\x3e [*]\n```\n\n> `[*]` 表示开始或者结束，如果在箭头右边则表示结束。\n\n```mermaid\nstateDiagram\n    [*] --\x3e s1\n    s1 --\x3e [*]\n```\n\n### 类图\n\n```\nclassDiagram\n      Animal <|-- Duck\n      Animal <|-- Fish\n      Animal <|-- Zebra\n      Animal : +int age\n      Animal : +String gender\n      Animal: +isMammal()\n      Animal: +mate()\n      class Duck{\n          +String beakColor\n          +swim()\n          +quack()\n      }\n      class Fish{\n          -int sizeInFeet\n          -canEat()\n      }\n      class Zebra{\n          +bool is_wild\n          +run()\n      }\n```\n\n> `<|--` 表示继承，`+` 表示 `public`，`-` 表示 `private`。\n\n```mermaid\nclassDiagram\n      Animal <|-- Duck\n      Animal <|-- Fish\n      Animal <|-- Zebra\n      Animal : +int age\n      Animal : +String gender\n      Animal: +isMammal()\n      Animal: +mate()\n      class Duck{\n          +String beakColor\n          +swim()\n          +quack()\n      }\n      class Fish{\n          -int sizeInFeet\n          -canEat()\n      }\n      class Zebra{\n          +bool is_wild\n          +run()\n      }\n```\n\n### 甘特图\n\n```\ngantt\n    title 工作计划\n    dateFormat  YYYY-MM-DD\n    section \t\tRun\n    Study\t\t\t:a1, 2020-01-01, 30d\n    Rest\t\t\t:after a1, 20d\n    section\t\t\tClass\n    Python      \t:2020-01-01, 15d\n    GO\t\t\t\t:15d\n```\n\n```mermaid\ngantt\n    title 工作计划\n    dateFormat  YYYY-MM-DD\n    section \t\tRun\n    Study\t\t\t:a1, 2020-01-01, 30d\n    Rest\t\t\t:after a1  , 20d\n    section\t\t\tClass\n    Python      \t:2020-01-01  , 15d\n    GO\t\t\t\t:15d\n```\n\n### 饼图\n\n```\npie\n    title 一张大饼\n    "工人阶级" : 80\n    "领导" : 17\n    "精英" : 3\n```\n\n```mermaid\npie\n    title 一张大饼\n    "工人阶级" : 80\n    "领导" : 17\n    "精英" : 3\n```\n'}}]);